import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import {Container, Paper} from "@mui/material";
import {useState} from "react";

export default function Person() {

    const paperStyle = {padding: '50px 20px', width: 600, margin: '20px auto'}
    const[name,setName] = useState('')
    const[anotherName, setAnotherName] = useState('')

    return (<Container>
            <Paper elevation={3} style={paperStyle}>

                <h1 style={{color:"blue"}}>
                    <u>Add a person</u>
                </h1>
                <Box
                    component="form"
                    sx={{
                        '& > :not(style)': {m: 1, width: '25ch'},
                    }}
                    noValidate
                    autoComplete="off"
                >
                    <TextField id="outlined-basic" label="Имя и Фамилия" variant="outlined"
                    value={name}
                    onChange={(e) => setName(e.target.value)}/>
                    <tr/>
                    <TextField id="outlined-basic" label="С кем вы будете?" variant="outlined"
                    value={anotherName}
                    onChange={(e) => setAnotherName(e.target.value)}/>
                </Box>
            </Paper>
        </Container>);
}
